import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>IP Address:</div><input />
      </header>
      <article className="App-header">
        <div>Hello</div>
      </article>
    </div>
  );
}

export default App;
